impl Solution {
    pub fn can_make_subsequence(str1: String, str2: String) -> bool {
        let mut i = 0; // Pointer for str1
        let mut j = 0; // Pointer for str2
        let s1 = str1.as_bytes();
        let s2 = str2.as_bytes();

        while i < str1.len() && j < str2.len() {
            if s1[i] == s2[j] {
                i += 1;
                j += 1;
            } else {
                let mut found = false;
                while i < str1.len() {
                    if ((s1[i] - b'a' + 1) % 26) + b'a' == s2[j] {
                        i += 1;
                        j += 1;
                        found = true;
                        break;
                    }
                    i += 1;
                }
                if !found {
                    return false;
                }
            }
        }

        j == str2.len()
    }
}
